import React from 'react'

function Movie({result}) { 
    // console.log({result})
    return (
        <div className="movie">
            <div className="movie-wrap">
            <h1 className='movie-title'>{result.Title}</h1>
            <img src={result.Poster} alt={result.Title}></img>
            </div>
        </div>
    )
}

export default Movie
